import axios from "axios";
const API_URL = 'http://localhost:3000/quotes';

export const getAllQuotes = async () => {
    let result = "";
    try {
       const response = await axios.get(API_URL);
       result = response.data;
    } catch (error) {
        result = error.message;
    }
    return result;
};

